import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import Dashboard from './Dashboard';
import ProductManagement from './ProductManagement';
import UserManagement from './UserManagement';

const App = () => {
    const [isSignedUp, setIsSignedUp] = useState(false);
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [products, setProducts] = useState([
        { id: 1, name: 'Chicken Wings', category: 'Food', quantity: 50, price: 10 },
        { id: 2, name: 'Soda', category: 'Beverage', quantity: 100, price: 1.5 },
    ]);

    const handleSignUp = () => setIsSignedUp(true);
    const handleLogin = () => {
        if (isSignedUp) setIsAuthenticated(true);
    };
    const handleLogout = () => setIsAuthenticated(false);

    const navStyles = {
        container: {
            background: '#333',
            padding: '1rem',
            display: 'flex',
            justifyContent: 'center',
        },
        link: {
            color: '#fff',
            textDecoration: 'none',
            margin: '0 1rem',
            padding: '0.5rem 1rem',
            borderRadius: '4px',
            background: '#555',
            transition: 'background 0.3s',
            cursor: 'pointer',
        },
    };

    return (
        <Router>
            <marquee>Limkokwing Wings Cafe</marquee>
            <div>
                <nav style={navStyles.container}>
                    {isAuthenticated && (
                        <>
                            <Link to="/dashboard" style={navStyles.link}>Dashboard</Link>
                            <Link to="/products" style={navStyles.link}>Product Management</Link>
                            <Link to="/login" style={navStyles.link} onClick={handleLogout}>Logout</Link>
                        </>
                    )}
                </nav>

                <Routes>
                    <Route
                        path="/signup"
                        element={
                            isSignedUp ? (
                                <Navigate to="/login" />
                            ) : (
                                <div style={{ textAlign: 'center', marginTop: '2rem' }}>
                                    <h2>Create an Account</h2>
                                    <button
                                        onClick={handleSignUp}
                                        style={{
                                            padding: '0.5rem 2rem',
                                            fontSize: '1rem',
                                            color: '#fff',
                                            background: '#007bff',
                                            border: 'none',
                                            borderRadius: '5px',
                                            cursor: 'pointer',
                                        }}
                                    >
                                        Sign Up
                                    </button>
                                </div>
                            )
                        }
                    />
                    <Route
                        path="/login"
                        element={
                            isAuthenticated ? (
                                <Navigate to="/products" />
                            ) : (
                                isSignedUp ? (
                                    <div style={{ textAlign: 'center', marginTop: '2rem' }}>
                                        <h2>Welcome Back!</h2>
                                        <button
                                            onClick={handleLogin}
                                            style={{
                                                padding: '0.5rem 2rem',
                                                fontSize: '1rem',
                                                color: '#fff',
                                                background: '#28a745',
                                                border: 'none',
                                                borderRadius: '5px',
                                                cursor: 'pointer',
                                            }}
                                        >
                                            Log In
                                        </button>
                                    </div>
                                ) : (
                                    <Navigate to="/signup" />
                                )
                            )
                        }
                    />
                    <Route
                        path="/products"
                        element={isAuthenticated ? <ProductManagement products={products} setProducts={setProducts} /> : <Navigate to="/login" />}
                    />
                    <Route
                        path="/dashboard"
                        element={isAuthenticated ? <Dashboard products={products} onLogout={handleLogout} /> : <Navigate to="/login" />}
                    />
                    <Route path="/" element={<Navigate to="/signup" />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
